INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt3748528', 'Rogue One: A Star Wars Story', 'Walt Disney Pictures', 'USA', 2016, 133, 'All looks lost for the Rebellion against the Empire as they learn of the existence of a new super weapon, the Death Star. Once a possible weakness in its construction is uncovered, the Rebel Alliance must set out on a desperate mission to steal the plans for the Death Star. The future of the entire galaxy now rests upon its success.', 'https://m.media-amazon.com/images/M/MV5BMjEwMzMxODIzOV5BMl5BanBnXkFtZTgwNzg3OTAzMDI@._V1_SX300.jpg', 7.80);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0086879', 'Amadeus', 'Warner Bros. Pictures', 'USA', 1984, 160, 'Antonio Salieri believes that Wolfgang Amadeus Mozart''s music is divine and miraculous. He wishes he was himself as good a musician as Mozart so that he can praise the Lord through composing. He began his career as a devout man who believes his success and talent as a composer are God''s rewards for his piety. He''s also content as the respected, financially well-off, court composer of Austrian Emperor Joseph II. But he''s shocked to learn that Mozart is such a vulgar creature, and can''t understand why God favored Mozart to be his instrument. Salieri''s envy has made him an enemy of God whose greatness was evident in Mozart. He is ready to take revenge against God and Mozart for his own musical mediocrity.', 'https://m.media-amazon.com/images/M/MV5BNWJlNzUzNGMtYTAwMS00ZjI2LWFmNWQtODcxNWUxODA5YmU1XkEyXkFqcGdeQXVyNTIzOTk5ODM@._V1_SX300.jpg', 8.30);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0118976', 'Didier', 'Chez Wam', 'FRA', 1997, 105, 'Jean-Pierre is a soccer player agent who is in a whole lot of trouble with his star players, who all got wounded just before a major game. One day, to do a favor to his sister Annabelle, he accepts to take care of her dog Didier. One night, Didier turns into a man while keeping the behavior of a dog...', 'https://m.media-amazon.com/images/M/MV5BODE2NzQ4MTI3OF5BMl5BanBnXkFtZTgwMzM0MzgwMzE@._V1_SX300.jpg', 6.20);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0119038', 'Le Dîner de Cons', 'Lions Gate Films Inc.', 'FRA', 1998, 80, 'To amuse themselves at a weekly dinner, a few well-heeled folk each bring a dimwit along who is to talk about his pastime. Each member seeks to introduce a champion dumbbell. Pierre, an avid participant of the game, runs into one problem after another that devilishly compromises his secrets, turning the tables on him and his objective, which diverges as the movie progresses. Firstly, wishing to be certain he has selected a winner, he invited his guest, Mr. Pignon, to meet him at home before setting off; but night of all nights, Pierre has put his back out and it is questionable whether he can manage to get to the dinner. The blundering Mr. Pignon will continually spring forward to help relieve Pierre of his troubles, which have drastically compounded, pointing in the direction of friends, taxes and women, and Pierre''s dimwit Pignon accordingly will prove his substance to the end.', 'https://m.media-amazon.com/images/M/MV5BZjFkOWM5NDUtODYwOS00ZDg0LWFkZGUtYzBkYzNjZjU3ODE3XkEyXkFqcGdeQXVyNzQzNzQxNzI@._V1_SX300.jpg', 7.70);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0211915', 'Amélie', 'Miramax Films', 'FRA', 2001, 122, 'Amélie is a story about a girl named Amélie whose childhood was suppressed by her Father''s mistaken concerns of a heart defect. With these concerns Amélie gets hardly any real life contact with other people. This leads Amélie to resort to her own fantastical world and dreams of love and beauty. She later on becomes a young woman and moves to the central part of Paris as a waitress. After finding a lost treasure belonging to the former occupant of her apartment, she decides to return it to him. After seeing his reaction and his new found perspective - she decides to devote her life to the people around her. Such as, her father who is obsessed with his garden-gnome, a failed writer, a hypochondriac, a man who stalks his ex girlfriends, the "ghost", a suppressed young soul, the love of her life and a man whose bones are as brittle as glass. But after consuming herself with these escapades - she finds out that she is disregarding her own life and damaging her quest for love. Amélie then discovers she must become more aggressive and take a hold of her life and capture the beauty of love she has always dreamed of.', 'https://m.media-amazon.com/images/M/MV5BNDg4NjM1YjMtYmNhZC00MjM0LWFiZmYtNGY1YjA3MzZmODc5XkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_SX300.jpg', 8.30);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0109830', 'Forrest Gump', 'Paramount Pictures', 'USA', 1994, 142, 'Forrest Gump is a simple man with a low I.Q. but good intentions. He is running through childhood with his best and only friend Jenny. His ''mama'' teaches him the ways of life and leaves him to choose his destiny. Forrest joins the army for service in Vietnam, finding new friends called Dan and Bubba, he wins medals, creates a famous shrimp fishing fleet, inspires people to jog, starts a ping-pong craze, creates the smiley, writes bumper stickers and songs, donates to people and meets the president several times. However, this is all irrelevant to Forrest who can only think of his childhood sweetheart Jenny Curran, who has messed up her life. Although in the end all he wants to prove is that anyone can love anyone.', 'https://m.media-amazon.com/images/M/MV5BNWIwODRlZTUtY2U3ZS00Yzg1LWJhNzYtMmZiYmEyNmU1NjMzXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 8.80);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0119164', 'The Full Monty', 'Twentieth Century Fox Home Entertainment', 'GBR', 1997, 91, 'Six unemployed steel workers, inspired by the Chippendale''s dancers, form a male striptease act. The women cheer them on to go for "the full monty" - total nudity.', 'https://m.media-amazon.com/images/M/MV5BODg0NWFjMTAtNGZjMC00NmZlLThhZDYtM2MzNTU2NDZiZDVmXkEyXkFqcGdeQXVyMDUyOTUyNQ@@._V1_SX300.jpg', 7.20);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0126029', 'Shrek', 'Dreamworks', 'USA', 2001, 90, 'When a green ogre named Shrek discovers his swamp has been ''swamped'' with all sorts of fairytale creatures by the scheming Lord Farquaad, Shrek sets out with a very loud donkey by his side to ''persuade'' Farquaad to give Shrek his swamp back. Instead, a deal is made. Farquaad, who wants to become the King, sends Shrek to rescue Princess Fiona, who is awaiting her true love in a tower guarded by a fire-breathing dragon. But once they head back with Fiona, it starts to become apparent that not only does Shrek, an ugly ogre, begin to fall in love with the lovely princess, but Fiona is also hiding a huge secret.', 'https://m.media-amazon.com/images/M/MV5BOGZhM2FhNTItODAzNi00YjA0LWEyN2UtNjJlYWQzYzU1MDg5L2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.80);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0029606', 'A Star Is Born', 'Image Entertainment Inc.', 'USA', 1937, 111, 'Esther Blodgett is just another starry-eyed farm kid trying to break into the movies. Waitressing at a Hollywood party, she catches the eye of alcoholic star Norman Maine, is given a test, and is caught up in the Hollywood glamor machine (ruthlessly satirized). She and her idol Norman marry; but his career abruptly dwindles to nothing', 'https://m.media-amazon.com/images/M/MV5BMmE5ODI0NzMtYjc5Yy00MzMzLTk5OTQtN2Q3MzgwOTllMTY3XkEyXkFqcGdeQXVyNjc0MzMzNjA@._V1_SX300.jpg', 7.30);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0095250', 'The Big Blue', '20th Century-Fox', 'FRA', 1988, 168, 'Enzo and Jacques have known each other for a long time. Their friendship started in their childhood days in the Mediterranean. They were not real friends in these days, but there was something they both loved and used to do the whole day long: diving. One day Jacques'' father, who was a diver too, died in the Mediterranean sea. After that incident Enzo and Jacques lost contact. After several years, Enzo and Jacques had grown up, Johanna, a young clerk in an insurance office, has to go to Peru. There she meets Jacques who is being studied by a group of scientists. He dives for some minutes into ice-cold water and the scientists monitor his physical state that is more like a dolphin than human. Johanna can not believe what she sees and gets very interested in Jacques but she''s unable to get acquainted with him. Some weeks later back in her office, she finds out that Jacques will be competing in a diving championship that takes place in Taormina, Sicily. In order to see Jacques again she makes up a story so the firm sends her to Italy for business purposes. In Taormina there is also Enzo, the reigning diving world champion. He knows that only Jacques can challenge and probably beat him. This time Johanna and Jacques get closer, but Jacques, being more a dolphin than man, cannot really commit and his rivalry with Enzo pushes both men into dangerous territory...', 'https://m.media-amazon.com/images/M/MV5BOTg5NGE1MjYtZjU3Zi00NWZhLTg4ZmEtMDI0YzMwN2Y2NDIxXkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_SX300.jpg', 7.60);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0097576', 'Indiana Jones and the Last Crusade', 'Paramount Pictures', 'USA', 1989, 127, 'An art collector appeals to Jones to embark on a search for the Holy Grail. He learns that another archaeologist has disappeared while searching for the precious goblet, and the missing man is his own father, Dr. Henry Jones. The artifact is much harder to find than they expected, and its powers are too much for those impure in heart.', 'https://m.media-amazon.com/images/M/MV5BMjNkMzc2N2QtNjVlNS00ZTk5LTg0MTgtODY2MDAwNTMwZjBjXkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_SX300.jpg', 8.20);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0087469', 'Indiana Jones and the Temple of Doom', 'Paramount Pictures', 'USA', 1984, 118, 'Set in 1935, a professor, archaeologist, and legendary hero by the name of Indiana Jones is back in action in his newest adventure. But this time he teams up with a night club singer named Wilhelmina "Willie" Scott and a twelve-year-old boy named Short Round. They end up in an Indian small distressed village, where the people believe that evil spirits have taken all their children away after a sacred precious stone was stolen! They also discovered the great mysterious terror surrounding a booby-trapped temple known as the Temple of Doom! Thuggee is beginning to attempt to rise once more, believing that with the power of all five Sankara stones they can rule the world! Now, it''s all up to Indiana to put an end to the Thuggee campaign, rescue the lost children, win the girl and conquer the Temple of Doom.', 'https://m.media-amazon.com/images/M/MV5BMGI1NTk2ZWMtMmI0YS00Yzg0LTljMzgtZTg4YjkyY2E5Zjc0XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_SX300.jpg', 7.60);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0367882', 'Indiana Jones and the Kingdom of the Crystal Skull', 'Paramount Pictures', 'USA', 2008, 122, 'During the Cold War, Soviet agents watch Professor Henry Jones when a young man brings him a coded message from an aged, demented colleague, Harold Oxley. Led by the brilliant Irina Spalko, the Soviets tail Jones and the young man, Mutt, to Peru. With Oxley''s code, they find a legendary skull made of a single piece of quartz. If Jones can deliver the skull to its rightful place, all may be well; but if Irina takes it to its origin, she''ll gain powers that could endanger the West. Aging professor and young buck join forces with a woman from Jones'' past to face the dangers of the jungle, Russia, and the supernatural.', 'https://m.media-amazon.com/images/M/MV5BMTIxNDUxNzcyMl5BMl5BanBnXkFtZTcwNTgwOTI3MQ@@._V1_SX300.jpg', 6.10);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0082971', 'Raiders of the Lost Ark', 'Paramount Pictures', 'USA', 1981, 115, 'The year is 1936. An archeology professor named Indiana Jones is venturing in the jungles of South America searching for a golden statue. Unfortunately, he sets off a deadly trap but miraculously escapes. Then, Jones hears from a museum curator named Marcus Brody about a biblical artifact called The Ark of the Covenant, which can hold the key to humanly existence. Jones has to venture to vast places such as Nepal and Egypt to find this artifact. However, he will have to fight his enemy Rene Belloq and a band of Nazis in order to reach it.', 'https://m.media-amazon.com/images/M/MV5BMjA0ODEzMTc1Nl5BMl5BanBnXkFtZTcwODM2MjAxNA@@._V1_SX300.jpg', 8.40);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0104507', 'Indochine', 'Sony Pictures Home Entertainment', 'FRA', 1992, 159, 'This story is set in 1930, at the time when French colonial rule in Indochina is ending. A widowed French woman who works in the rubber fields, raises a Vietnamese princess as if she was her own daughter. She, and her daughter both fall in love with a young French navy officer, which will change both their lives significantly.', 'https://m.media-amazon.com/images/M/MV5BZWJiNjFmOGYtMWY4ZC00MGUxLTgzOTUtNGJjNWQzNGZlZDc0XkEyXkFqcGdeQXVyNjMwMjk0MTQ@._V1_SX300.jpg', 7.10);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0133093', 'The Matrix', 'Warner Bros. Pictures', 'USA', 1999, 136, 'Thomas A. Anderson is a man living two lives. By day he is an average computer programmer and by night a hacker known as Neo. Neo has always questioned his reality, but the truth is far beyond his imagination. Neo finds himself targeted by the police when he is contacted by Morpheus, a legendary computer hacker branded a terrorist by the government. Morpheus awakens Neo to the real world, a ravaged wasteland where most of humanity have been captured by a race of machines that live off of the humans'' body heat and electrochemical energy and who imprison their minds within an artificial reality known as the Matrix. As a rebel against the machines, Neo must return to the Matrix and confront the agents: super-powerful computer programs devoted to snuffing out Neo and the entire human rebellion.', 'https://m.media-amazon.com/images/M/MV5BNzQzOTk3OTAtNDQ0Zi00ZTVkLWI0MTEtMDllZjNkYzNjNTc4L2ltYWdlXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_SX300.jpg', 8.70);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0095800', 'The Bear', 'Sony Pictures Home Entertainment', 'FRA', 1988, 96, 'The director of _Quest for Fire_ creates yet another film in nature with almost no human dialogue in this picturesque story of an orphaned bear cub who is adopted by an adult male bear and must avoid hunters. Bart the Bear stars in this anthropomorphic fantasy.', 'https://m.media-amazon.com/images/M/MV5BNmQ5MTQ4YTktNmI5ZS00MGIxLTkxM2UtYzMwMmFiYWRhNWU1XkEyXkFqcGdeQXVyNjMwMjk0MTQ@._V1_SX300.jpg', 7.70);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0082484', 'Quest for Fire', 'Fox', 'CAN', 1981, 100, 'Anthony Burgess created the primitive language for the early humans in this prehistoric adventure about a trio of warriors who travel the savanna, encountering sabre-toothed tigers, mammoths and cannibalistic tribes in search of a flame that would replace the fire their tribe has lost.', 'https://m.media-amazon.com/images/M/MV5BNzIwMGQwMTAtNzg1OC00ZjViLWI1ZTAtNjliODJlNjUzMzhhXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.30);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0080684', 'Star Wars: Episode V - The Empire Strikes Back', 'Twentieth Century Fox', 'USA', 1980, 124, 'Luke Skywalker, Han Solo, Princess Leia and Chewbacca face attack by the Imperial forces and its AT-AT walkers on the ice planet Hoth. While Han and Leia escape in the Millennium Falcon, Luke travels to Dagobah in search of Yoda. Only with the Jedi master''s help will Luke survive when the dark side of the Force beckons him into the ultimate duel with Darth Vader.', 'https://m.media-amazon.com/images/M/MV5BYmU1NDRjNDgtMzhiMi00NjZmLTg5NGItZDNiZjU5NTU4OTE0XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_SX300.jpg', 8.70);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0086190', 'Star Wars: Episode VI - Return of the Jedi', 'Twentieth Century Fox', 'USA', 1983, 131, 'Luke Skywalker battles horrible Jabba the Hut and cruel Darth Vader to save his comrades in the Rebel Alliance and triumph over the Galactic Empire. Han Solo and Princess Leia reaffirm their love and team with Chewbacca, Lando Calrissian, the Ewoks and the androids C-3PO and R2-D2 to aid in the disruption of the Dark Side and the defeat of the evil emperor.', 'https://m.media-amazon.com/images/M/MV5BOWZlMjFiYzgtMTUzNC00Y2IzLTk1NTMtZmNhMTczNTk0ODk1XkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_SX300.jpg', 8.30);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt2488496', 'Star Wars: Episode VII - The Force Awakens', 'Walt Disney Pictures', 'USA', 2015, 138, '30 years after the defeat of Darth Vader and the Empire, Rey, a scavenger from the planet Jakku, finds a BB-8 droid that knows the whereabouts of the long lost Luke Skywalker. Rey, as well as a rogue stormtrooper and two smugglers, are thrown into the middle of a battle between the Resistance and the daunting legions of the First Order.', 'https://m.media-amazon.com/images/M/MV5BOTAzODEzNDAzMl5BMl5BanBnXkFtZTgwMDU1MTgzNzE@._V1_SX300.jpg', 7.90);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt2527336', 'Star Wars: Episode VIII - The Last Jedi', 'Walt Disney Pictures', 'USA', 2017, 151, 'Rey develops her newly discovered abilities with the guidance of Luke Skywalker, who is unsettled by the strength of her powers. Meanwhile, the Resistance prepares for battle with the First Order.', 'https://m.media-amazon.com/images/M/MV5BMjQ1MzcxNjg4N15BMl5BanBnXkFtZTgwNzgwMjY4MzI@._V1_SX300.jpg', 7.00);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt3778644', 'Solo: A Star Wars Story', 'Walt Disney Pictures', 'USA', 2018, 135, 'During an adventure into the criminal underworld, Han Solo meets his future co-pilot Chewbacca and encounters Lando Calrissian years before joining the Rebellion.', 'https://m.media-amazon.com/images/M/MV5BOTM2NTI3NTc3Nl5BMl5BanBnXkFtZTgwNzM1OTQyNTM@._V1_SX300.jpg', 6.90);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0120338', 'Titanic', 'Paramount Pictures', 'USA', 1997, 194, '84 years later, a 100 year-old woman named Rose DeWitt Bukater tells the story to her granddaughter Lizzy Calvert, Brock Lovett, Lewis Bodine, Bobby Buell and Anatoly Mikailavich on the Keldysh about her life set in April 10th 1912, on a ship called Titanic when young Rose boards the departing ship with the upper-class passengers and her mother, Ruth DeWitt Bukater, and her fiancé, Caledon Hockley. Meanwhile, a drifter and artist named Jack Dawson and his best friend Fabrizio De Rossi win third-class tickets to the ship in a game. And she explains the whole story from departure until the death of Titanic on its first and last voyage April 15th, 1912 at 2:20 in the morning.', 'https://m.media-amazon.com/images/M/MV5BMDdmZGU3NDQtY2E5My00ZTliLWIzOTUtMTY4ZGI1YjdiNjk3XkEyXkFqcGdeQXVyNTA4NzY1MzY@._V1_SX300.jpg', 7.80);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt1408101', 'Star Trek Into Darkness', 'Paramount', 'USA', 2013, 132, 'When the USS Enterprise crew is called back home, they find an unstoppable force of terror from within their own organization has detonated the fleet and everything it stands for, leaving our world in a state of crisis. With a personal score to settle, Captain Kirk leads a manhunt to a war-zone world to capture a one-man weapon of mass destruction. As our space heroes are propelled into an epic chess game of life and death, love will be challenged, friendships will be torn apart, and sacrifices must be made for the only family Kirk has left: his crew.', 'https://m.media-amazon.com/images/M/MV5BMTk2NzczOTgxNF5BMl5BanBnXkFtZTcwODQ5ODczOQ@@._V1_SX300.jpg', 7.70);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0024216', 'King Kong', 'RKO Pictures', 'USA', 1933, 100, 'Carl Denham needs to finish his movie and has the perfect location; Skull Island. But he still needs to find a leading lady. This ''soon-to-be-unfortunate'' soul is Ann Darrow. No one knows what they will encounter on this island and why it is so mysterious, but once they reach it, they will soon find out. Living on this hidden island is a giant gorilla and this beast now has Ann in it''s grasps. Carl and Ann''s new love, Jack Driscoll must travel through the jungle looking for Kong and Ann, whilst avoiding all sorts of creatures and beasts.', 'https://m.media-amazon.com/images/M/MV5BZTY3YjYxZGQtMTM2YS00ZmYwLWFlM2QtOWFlMTU1NTAyZDQ2XkEyXkFqcGdeQXVyNTgyNTA4MjM@._V1_SX300.jpg', 7.90);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0076759', 'Star Wars: Episode IV - A New Hope', '20th Century Fox', 'USA', 1977, 121, 'The Imperial Forces, under orders from cruel Darth Vader, hold Princess Leia hostage in their efforts to quell the rebellion against the Galactic Empire. Luke Skywalker and Han Solo, captain of the Millennium Falcon, work together with the companionable droid duo R2-D2 and C-3PO to rescue the beautiful princess, help the Rebel Alliance and restore freedom and justice to the Galaxy.', 'https://m.media-amazon.com/images/M/MV5BMWExNzQ5MWEtMDNkNS00MDRmLThiYWQtNjQ5MzM0OTNkNTM4XkEyXkFqcGc@._V1_QL75_UX212_.jpg', 8.60);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0360717', 'King Kong', 'Universal Pictures', 'NZL', 2005, 187, 'Carl Denham needs to finish his movie and has the perfect location; Skull Island. But he still needs to find a leading lady. This ''soon-to-be-unfortunate'' soul is Ann Darrow. No one knows what they will encounter on this island and why it is so mysterious, but once they reach it, they will soon find out. Living on this hidden island is a giant gorilla and this beast now has Ann is its grasps. Carl and Ann''s new love, Jack Driscoll must travel through the jungle looking for Kong and Ann, whilst avoiding all sorts of creatures and beasts. But Carl has another plan in mind.', 'https://m.media-amazon.com/images/M/MV5BMjYxYmRlZWYtMzAwNC00MDA1LWJjNTItOTBjMzlhNGMzYzk3XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.20);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt5311514', 'Your Name.', 'FUNimation Films', 'JPN', 2016, 106, 'Mitsuha is the daughter of the mayor of a small mountain town. She''s a straightforward high school girl who lives with her sister and her grandmother and has no qualms about letting it be known that she''s uninterested in Shinto rituals or helping her father''s electoral campaign. Instead she dreams of leaving the boring town and trying her luck in Tokyo. Taki is a high school boy in Tokyo who works part-time in an Italian restaurant and aspires to become an architect or an artist. Every night he has a strange dream where he becomes...a high school girl in a small mountain town.', 'https://m.media-amazon.com/images/M/MV5BODRmZDVmNzUtZDA4ZC00NjhkLWI2M2UtN2M0ZDIzNDcxYThjL2ltYWdlXkEyXkFqcGdeQXVyNTk0MzMzODA@._V1_SX300.jpg', 8.40);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0109440', 'Fear City: A Family-Style Comedy', 'M6 Films', 'FRA', 1994, 93, 'Odile Deray est attaché de presse pour le film "Red is Dead". Mais au festival de Cannes, personne ne veut regarder un tel navet. Pourtant, les gens changent d''avis au moment où les projectionnistes meurtent les un après les autres, assassiné par le méchant de "Red is Dead". Serge Kazamarov est envoyé sur place pour protéger la victime suivante. Quelques jours plus tard, la salle est comble et même le gratin de Cannes est sur place...', 'https://m.media-amazon.com/images/M/MV5BMTI1ODgxNzc2NF5BMl5BanBnXkFtZTcwMDg0MzQyMQ@@._V1_SX300.jpg', 7.70);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt7286456', 'Joker', 'Warner Bros. Pictures', 'CAN', 2019, 122, 'In Gotham City, mentally troubled comedian Arthur Fleck is disregarded and mistreated by society. He then embarks on a downward spiral of revolution and bloody crime. This path brings him face-to-face with his alter-ego: the Joker.', 'https://m.media-amazon.com/images/M/MV5BNGVjNWI4ZGUtNzE0MS00YTJmLWE0ZDctN2ZiYTk2YmI3NTYyXkEyXkFqcGdeQXVyMTkxNjUyNQ@@._V1_SX300.jpg', 8.60);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0103639', 'Aladdin', 'Walt Disney Pictures', 'USA', 1992, 90, 'Aladdin is a poor street urchin who spends his time stealing food from the marketplace in the city of Agrabah. His adventures begin when he meets a young girl who happens to be Princess Jasmine, who is forced to be married by her wacky yet estranged father. Aladdin''s luck suddenly changes when he retrieves a magical lamp from the Cave of Wonders. What he unwittingly gets is a fun-loving genie who only wishes to have his freedom. Little do they know is that the Sultan''s sinister advisor Jafar has his own plans for both Aladdin and the lamp.', 'https://m.media-amazon.com/images/M/MV5BODQ2YTY2ZjEtYTgxOS00YjQyLThmNTktYzQ4MDlhOGMxNGJiXkEyXkFqcGc@._V1_QL75_UX248_.jpg', 8.00);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0117731', 'Star Trek: First Contact', 'Paramount Pictures', 'USA', 1996, 111, 'In the 24th century, the crew of the Enterprise-E has been ordered to patrol the Romulan Neutral Zone by the Federation to avoid interference with their battle against the insidious Borg. Witnessing the loss of the battle, Captain Jean-Luc Picard ignores orders and takes command of the fleet engaging the Borg. But the Borg plan to travel back into the 21st century through a vortex with the intention to stop Earth''s first contact with an alien race (the Vulcans). Following the Borg sphere, Picard and his crew realize that they have taken over the Enterprise in order to carry out their mission. Their only chance to do away with the Borg and their seductive queen is to make sure that Zefram Cochrane makes his famous faster-than-light travel to the stars.', 'https://m.media-amazon.com/images/M/MV5BYmZjNmU0ZWYtMzkwNy00ZGQzLWFkMDAtMDBjYmMzNmFhMGUzXkEyXkFqcGc@._V1_QL75_UX820_.jpg', 7.60);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0120737', 'The Lord of the Rings: The Fellowship of the Ring', 'New Line Cinema', 'NZL', 2001, 178, 'An ancient Ring thought lost for centuries has been found, and through a strange twist in fate has been given to a small Hobbit named Frodo. When Gandalf discovers the Ring is in fact the One Ring of the Dark Lord Sauron, Frodo must make an epic quest to the Cracks of Doom in order to destroy it! However he does not go alone. He is joined by Gandalf, Legolas the elf, Gimli the Dwarf, Aragorn, Boromir and his three Hobbit friends Merry, Pippin and Samwise. Through mountains, snow, darkness, forests, rivers and plains, facing evil and danger at every corner the Fellowship of the Ring must go. Their quest to destroy the One Ring is the only hope for the end of the Dark Lords reign!', 'https://m.media-amazon.com/images/M/MV5BN2EyZjM3NzUtNWUzMi00MTgxLWI0NTctMzY4M2VlOTdjZWRiXkEyXkFqcGdeQXVyNDUzOTQ5MjY@._V1_SX300.jpg', 8.80);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0167261', 'The Lord of the Rings: The Two Towers', 'New Line Cinema', 'NZL', 2002, 179, 'While Frodo and Sam, now accompanied by a new guide, continue their hopeless journey towards the land of shadow to destroy the One Ring, each member of the broken fellowship plays their part in the battle against the evil wizard Saruman and his armies of Isengard.', 'https://m.media-amazon.com/images/M/MV5BNGE5MzIyNTAtNWFlMC00NDA2LWJiMjItMjc4Yjg1OWM5NzhhXkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_SX300.jpg', 8.70);
INSERT INTO moviez.films (id, titre, producteur, codepays, annee, duree, resume, affiche, note) VALUES ('tt0167260', 'The Lord of the Rings: The Return of the King', 'New Line Cinema', 'NZL', 2003, 201, 'The final confrontation between the forces of good and evil fighting for control of the future of Middle-earth. Hobbits: Frodo and Sam reach Mordor in their quest to destroy the "one ring", while Aragorn leads the forces of good against Sauron''s evil army at the stone city of Minas Tirith.', 'https://m.media-amazon.com/images/M/MV5BNzA5ZDNlZWMtM2NhNS00NDJjLTk4NDItYTRmY2EwMWZlMTY3XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_SX300.jpg', 8.90);
